    "region-9-npdes-outfalls",nt"isopen": false,nt"url": null,nt"notes":
    "Point geospatial dataset representing locations of NPDES outfalls/dischargers
    for facilities which generally represent the site of the discharge. NPDES (National
    Pollution Discharge Elimination System) is an EPA permit program that regulates
    direct discharges from treated waste water that is discharged into waters of the
    US. Facilities are issued NPDES permits regulating their discharge as required by
    the Clean Water Act. A facility may have one or more dischargers. The location represents
    the discharge point of a discrete conveyance such as a pipe or man made ditch.",nt"license_title":
